  "_globalState" : 
    "name" : "_globalState"
    "qualifiedname" : "_isolate_helper._globalState"
    "comment" : "<hr /> <p>  Inserted from lib/isolate/dart2js/isolateimpl.dart</p> <hr /> <p>Concepts used here:</p> <p>\"manager\" - A manager contains one or more isolates, schedules their execution, and performs other plumbing on their behalf.  The isolate present at the creation of the manager is designated as its \"root isolate\". A manager may, for example, be implemented on a web Worker.</p> <p><code>_Manager</code> - State present within a manager (exactly once, as a global).</p> <p><code>_ManagerStub</code> - A handle held within one manager that allows interaction with another manager.  A target manager may be addressed by zero or more <code>_ManagerStub</code>s. TODO(ahe): The <em>ManagerStub concept is broken.  It was an attempt to create a common interface between the native Worker class and </em>MainManagerStub.</p> <p>A native object that is shared across isolates. This object is visible to all isolates running under the same manager (either UI or background web worker).</p> <p>This is code that is intended to 'escape' the isolate boundaries in order to implement the semantics of isolates in JavaScript. Without this we would have been forced to implement more code (including the top-level event loop) in JavaScript itself.</p>"
    "type" : "getter"
    "static" : "false"
    "return" : "_isolate_helper._Manager"
    "parameters" : 
